import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';

const IELTSAcademic = () => {
    return (<Router>
                <Route exact path="/IELTSAcademic/AcademicListening"><h1>Academic Listening</h1></Route>
                <Route exact path="/IELTSAcademic/AcademicReading"><h1>Academic Reading</h1></Route>
                <Route exact path="/IELTSAcademic/AcademicWriting1"><h1>Academic Writing1</h1></Route>
                <Route exact path="/IELTSAcademic/AcademicWriting2"><h1>Academic Writing2</h1></Route>
            </Router>)
    
}

export default IELTSAcademic;
